function byte_msb(bb) {
    let result = 0
    if (bb > 0x0F) {
        bb >>= 4;
        result += 4;
    }
    if (bb > 0x07) {
        bb >>= 2;
        result += 2;
    }
    if (bb > 0x03) {
        bb >>= 1;
        result += 1;
    }
    if (bb > 0x01) {
        result += 1;
    }
    return result 
}

