function byteswap(b) {

    b = ((b >> 8n) & 0x00FF00FF00FF00FFn) | ((b & 0x00FF00FF00FF00FFn) << 8n);
    b = ((b >> 16n) & 0x0000FFFF0000FFFFn) | ((b & 0x0000FFFF0000FFFFn) << 16n);

    return (b >> 32n) | (b << 32n)
    // return BigInt.asUintN(64, (b >> 32n) | (b << 32n))
}



