function diagonalMask(sq) {    
    let diag  = (sq & 7) - ( sq >> 3);
    return (diag >= 0) ? maindia >> BigInt(diag * 8)  : maindia << BigInt(-diag * 8) ;
}

function antiDiagMask(sq) {    
    let diag  = 7 - (sq&7) - (sq>>3);
    return (diag >= 0) ? mainantidia >> BigInt(diag*8) : mainantidia << BigInt(-diag*8);
}
